import React from 'react';
import '../style.css'

function Footer() {
    return (
      <nav class="navbar fixed-bottom navbar-light bg-light ksfooter">
      <div class="container-fluid">
        <a class="navbar-brand" href="#">Kylie Shinn Web Portfolio </a>
      </div>
    </nav>
    );
  }

export default Footer;
